kipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1,_%D0%A5%D1%80%D0%B8%D1%81%D1%82%D0%BE%D1%84%D0%BE%D1%80\" title=\"\u041a\u043e\u043b\u0443\u043c\u0431, \u0425\u0440\u0438\u0441\u0442\u043e\u0444\u043e\u0440\">\u041a\u043e\u043b\u0443\u043c\u0431\u0430<\/a> \u043e\u0442\u043a\u0440\u044b\u0442\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%80%D0%B3%D0%B0%D1%81%D1%81%D0%BE%D0%B2%D0%BE_%D0%BC%D0%BE%D1%80%D0%B5\" title=\"\u0421\u0430\u0440\u0433\u0430\u0441\u0441\u043e\u0432\u043e \u043c\u043e\u0440\u0435\">\u0421\u0430\u0440\u0433\u0430\u0441\u0441\u043e\u0432\u043e \u043c\u043e\u0440\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1658_%D0%B3%D0%BE%D0%B4\" title=\"1658 \u0433\u043e\u0434\">1658<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%82%D0%BC%D0%B0%D0%BD_%D0%92%D0%BE%D0%B9%D1%81%D0%BA%D0%B0_%D0%97%D0%B0%D0%BF%D0%BE%D1%80%D0%BE%D0%B6%D1%81%D0%BA%D0%BE%D0%B3%D0%BE\" title=\"\u0413\u0435\u0442\u043c\u0430\u043d \u0412\u043e\u0439\u0441\u043a\u0430 \u0417\u0430\u043f\u043e\u0440\u043e\u0436\u0441\u043a\u043e\u0433\u043e\">\u0433\u0435\u0442\u043c\u0430\u043d \u0412\u043e\u0439\u0441\u043a\u0430 \u0417\u0430\u043f\u043e\u0440\u043e\u0436\u0441\u043a\u043e\u0433\u043e<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%8B%D0%B3%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%95%D0%B2%D1%81%D1%82%D0%B0%D1%84%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0412\u044b\u0433\u043e\u0432\u0441\u043a\u0438\u0439, \u0418\u0432\u0430\u043d \u0415\u0432\u0441\u0442\u0430\u0444\u044c\u0435\u0432\u0438\u0447\">\u0418\u0432\u0430\u043d \u0412\u044b\u0433\u043e\u0432\u0441\u043a\u0438\u0439<\/a> \u0437\u0430\u043a\u043b\u044e\u0447\u0438\u043b \u0441 \u0420\u0435\u0447\u044c\u044e \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B4%D1%8F%D1%87%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_1658\" class=\"mw-redirect\" title=\"\u0413\u0430\u0434\u044f\u0447\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 1658\">\u0413\u0430\u0434\u044f\u0447\u0441\u043a\u0438\u0439 \u0442\u0440\u0430\u043a\u0442\u0430\u0442<\/a> \u043e \u0432\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u0438 \u043a\u0430\u0437\u0430\u043a\u043e\u0432 \u0432 \u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0435 \u043f\u043e\u0434\u0434\u0430\u043d\u0441\u0442\u0432\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1773_%D0%B3%D0%BE%D0%B4\" title=\"1773 \u0433\u043e\u0434\">1773<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D0%A8%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u041d\u043e\u0432\u0430\u044f \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f\">\u041d\u043e\u0432\u0443\u044e \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044e<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0430<\/a>) \u043f\u0440\u0438\u0431\u044b\u043b \u043a\u043e\u0440\u0430\u0431\u043b\u044c \u00ab\u0413\u0435\u043a\u0442\u043e\u0440\u00bb \u0441 \u0448\u043e\u0442\u043b\u0430\u043d\u0434\u0441\u043a\u0438\u043c\u0438 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0446\u0430\u043c\u0438 \u043d\u0430 \u0431\u043e\u0440\u0442\u0443, \u043f\u043e\u0441\u043b\u0435 \u0447\u0435\u0433\u043e \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u0432\u043e\u043b\u043d\u0430 \u044d\u043c\u0438\u0433\u0440\u0430\u0446\u0438\u0438 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f\">\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u0438<\/a> \u0432 \u041a\u0430\u043d\u0430\u0434\u0443.<\/li><\/ul><h3><a href=\"https:\/\/ru.wikipedia.org\/wiki\/XIX_%D0%B2%D0%B5%D0%BA\" title=\"XIX \u0432\u0435\u043a\">XIX \u0432\u0435\u043a<\/a> <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1810_%D0%B3%D0%BE%D0%B4\" title=\"1810 \u0433\u043e\u0434\">1810<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%B0\" title=\"\u041c\u0435\u043a\u0441\u0438\u043a\u0430\">\u041c\u0435\u043a\u0441\u0438\u043a\u0430<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B7%D0%B0%D0%B2%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D1%8C\" title=\"\u041d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c\">\u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c<\/a> \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a> \u0438 \u043d\u0430\u0447\u0430\u043b\u0430 \u0432\u043e\u0439\u043d\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1821_%D0%B3%D0%BE%D0%B4\" title=\"1821 \u0433\u043e\u0434\">1821<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f<\/a> \u043f\u043e\u0434\u0442\u0432\u0435\u0440\u0434\u0438\u043b\u0430 \u0441\u0432\u043e\u0438 \u0438\u0441\u043a\u043b\u044e\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u043f\u0440\u0430\u0432\u0430 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8F%D1%81%D0%BA%D0%B0\" title=\"\u0410\u043b\u044f\u0441\u043a\u0430\">\u0410\u043b\u044f\u0441\u043a\u0443<\/a>. \u041e\u0434\u043d\u0430\u043a\u043e \u044d\u0442\u043e \u043d\u0435 \u043f\u043e\u043c\u0435\u0448\u0430\u043b\u043e \u0447\u0435\u0440\u0435\u0437 46 \u043b\u0435\u0442 \u043f\u0440\u043e\u0434\u0430\u0442\u044c \u0435\u0451 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u043d\u044b\u043c \u0428\u0442\u0430\u0442\u0430\u043c \u0410\u043c\u0435\u0440\u0438\u043a\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1828_%D0%B3%D0%BE%D0%B4\" title=\"1828 \u0433\u043e\u0434\">1828<\/a>&#160;\u2014 \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u0438 \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D0%B8%D1%8F\" title=\"\u0411\u0440\u0430\u0437\u0438\u043b\u0438\u044f\">\u0411\u0440\u0430\u0437\u0438\u043b\u0438\u0438<\/a> \u043f\u043e\u0434 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u043c \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D0%BD%D0%B3%D1%81%D0%B4%D0%BE%D1%80%D1%84,_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D0%B9_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041b\u0430\u043d\u0433\u0441\u0434\u043e\u0440\u0444, \u0413\u0440\u0438\u0433\u043e\u0440\u0438\u0439 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0413\u0440\u0438\u0433\u043e\u0440\u0438\u044f \u041b\u0430\u043d\u0433\u0441\u0434\u043e\u0440\u0444\u0430<\/a> \u043f\u0440\u0438\u0431\u044b\u043b\u0438 \u0432 \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D0%B5%D0%BD_(%D0%9F%D0%B0%D1%80%D0%B0)\" title=\"\u0411\u0435\u043b\u0435\u043d (\u041f\u0430\u0440\u0430)\">\u041f\u0430\u0440\u0430 (\u0411\u0435\u043b\u0435\u043d)<\/a>, \u043e\u0442\u043a\u0443\u0434\u0430 \u0432\u0435\u0441\u043d\u043e\u0439 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0435\u0433\u043e \u0433\u043e\u0434\u0430 \u0441\u0443\u043c\u0435\u043b\u0438 \u043c\u043e\u0440\u0435\u043c \u0434\u043e\u0431\u0440\u0430\u0442\u044c\u0441\u044f \u0434\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BE-%D0%B4%D0%B5-%D0%96%D0%B0%D0%BD%D0%B5%D0%B9%D1%80%D0%BE\" title=\"\u0420\u0438\u043e-\u0434\u0435-\u0416\u0430\u043d\u0435\u0439\u0440\u043e\">\u0420\u0438\u043e-\u0434\u0435-\u0416\u0430\u043d\u0435\u0439\u0440\u043e<\/a>. \u041b\u0430\u043d\u0433\u0441\u0434\u043e\u0440\u0444 \u0431\u044b\u043b \u0440\u0443\u0441\u0441\u043a\u0438\u043c \u043a\u043e\u043d\u0441\u0443\u043b\u043e\u043c \u0432 \u0420\u0438\u043e-\u0434\u0435-\u0416\u0430\u043d\u0435\u0439\u0440\u043e, \u0432 1821 \u0433\u043e\u0434\u0443 \u043e\u043d \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043b \u0431\u043e\u043b\u044c\u0448\u0443\u044e \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044e \u0432\u043e \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0435 \u0440\u0430\u0439\u043e\u043d\u044b \u0411\u0440\u0430\u0437\u0438\u043b\u0438\u0438. \u041f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u043c\u0430\u0440\u0448\u0440\u0443\u0442 \u043e\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u0441\u0430\u043c\u044b\u043c \u0442\u0440\u0443\u0434\u043d\u044b\u043c \u0438 \u0434\u0440\u0430\u043c\u0430\u0442\u0438\u0447\u043d\u044b\u043c: \u043f\u043e\u0447\u0442\u0438 \u0432\u0441\u0435 \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u0438 \u0442\u044f\u0436\u0435\u043b\u043e \u0437\u0430\u0431\u043e\u043b\u0435\u043b\u0438, \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043f\u043e\u0433\u0438\u0431\u043b\u0438. \u0421\u0430\u043c \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u043a \u0432\u0435\u0440\u043d\u0443\u043b\u0441\u044f \u0432 \u0415\u0432\u0440\u043e\u043f\u0443 \u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u043e \u0431\u043e\u043b\u044c\u043d\u044b\u043c \u0438 \u043d\u0435\u0441\u043f\u043e\u0441\u043e\u0431\u043d\u044b\u043c \u043a \u0440\u0430\u0431\u043e\u0442\u0435 \u0432\u0432\u0438\u0434\u0443 \u043f\u0441\u0438\u0445\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0440\u0430\u0441\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u0430. \u041e\u0433\u0440\u043e\u043c\u043d\u044b\u0439 \u0441\u043e\u0431\u0440\u0430\u043d\u043d\u044b\u0439 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u0438 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0434\u043e\u043b\u0433\u0438\u0435 \u0433\u043e\u0434\u044b \u0441\u0447\u0438\u0442\u0430\u043b\u0438 \u0443\u0442\u0435\u0440\u044f\u043d\u043d\u044b\u043c, \u043f\u043e\u0447\u0442\u0438 100 \u043b\u0435\u0442 \u043e \u043d\u0435\u0439 \u043d\u0435 \u0432\u0441\u043f\u043e\u043c\u0438\u043d\u0430\u043b\u0438, \u0438 \u043b\u0438\u0448\u044c \u043a \u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0435 \u043f\u0440\u043e\u0448\u043b\u043e\u0433\u043e \u0432\u0435\u043a\u0430 \u0431\u044b\u043b\u043e \u0432\u043e\u0437\u0434\u0430\u043d\u043e \u0434\u043e\u043b\u0436\u043d\u043e\u0435 \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u0430\u043c \u0437\u0430\u0431\u044b\u0442\u043e\u0439 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1857_%D0%B3%D0%BE%D0%B4\" title=\"1857 \u0433\u043e\u0434\">1857<\/a>&#160;\u2014 \u0414\u0436\u0435\u0439\u043d \u041f\u0438\u0440\u043f\u043e\u043d\u0442 (Jane Pierpont) \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%81%D1%82%D0%BE%D0%BD\" title=\"\u0411\u043e\u0441\u0442\u043e\u043d\">\u0411\u043e\u0441\u0442\u043e\u043d\u0430<\/a> \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0430 \u0430\u0432\u0442\u043e\u0440\u0441\u043a\u0438\u0435 \u043f\u0440\u0430\u0432\u0430 \u043d\u0430 \u043f\u0435\u0441\u043d\u044e \u00abOne Horse Open Sleigh\u00bb, \u0431\u043e\u043b\u0435\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0443\u044e \u043a\u0430\u043a \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Jingle_Bells\" title=\"Jingle Bells\">Jingle Bells<\/a>\u00bb. \u042d\u0442\u0430 \u0440\u043e\u0436\u0434\u0435\u0441\u0442\u0432\u0435\u043d\u0441\u043a\u0430\u044f \u043f\u0435\u0441\u0435\u043d\u043a\u0430 \u0431\u044b\u043b\u0430 \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0430 \u0434\u043b\u044f \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0432 \u0432\u043e\u0441\u043a\u0440\u0435\u0441\u043d\u043e\u0439 \u0448\u043a\u043e\u043b\u0435 \u0438 \u043d\u044b\u043d\u0435 \u0431\u0435\u0437 \u043d\u0435\u0451 \u043d\u0435 \u043e\u0431\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u043d\u0438 \u043e\u0434\u0438\u043d \u0440\u043e\u0436\u0434\u0435\u0441\u0442\u0432\u0435\u043d\u0441\u043a\u0438\u0439 \u043f\u0440\u0430\u0437\u0434\u043d\u0438\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1859_%D0%B3%D0%BE%D0%B4\" title=\"1859 \u0433\u043e\u0434\">1859<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439<\/a> \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%B8%D0%BD%D0%B3%D1%81%D1%82%D0%BE%D0%BD,_%D0%94%D0%B0%D0%B2%D0%B8%D0%B4\" title=\"\u041b\u0438\u0432\u0438\u043d\u0433\u0441\u0442\u043e\u043d, \u0414\u0430\u0432\u0438\u0434\">\u0414\u0430\u0432\u0438\u0434 \u041b\u0438\u0432\u0438\u043d\u0433\u0441\u0442\u043e\u043d<\/a> \u043e\u0442\u043a\u0440\u044b\u043b \u043e\u0437\u0435\u0440\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BB%D0%B0%D0%B2%D0%B8_(%D0%BE%D0%B7%D0%B5%D1%80%D0%BE)\" class=\"mw-redirect\"