B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u043d\u0435\u0438\u0437\u043c\u0435\u043d\u043d\u043e \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0438 \u0440\u0430\u0441\u043f\u0430\u0432\u0448\u0443\u044e\u0441\u044f \u043a \u044d\u0442\u043e\u043c\u0443 \u043c\u043e\u043c\u0435\u043d\u0442\u0443 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/The_Beatles\" title=\"The Beatles\">The Beatles<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1971_%D0%B3%D0%BE%D0%B4\" title=\"1971 \u0433\u043e\u0434\">1971<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%A2%D1%83-134_%D0%BF%D0%BE%D0%B4_%D0%9A%D0%B8%D0%B5%D0%B2%D0%BE%D0%BC\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-134 \u043f\u043e\u0434 \u041a\u0438\u0435\u0432\u043e\u043c\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-134 \u043f\u043e\u0434 \u041a\u0438\u0435\u0432\u043e\u043c<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 49 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1975_%D0%B3%D0%BE%D0%B4\" title=\"1975 \u0433\u043e\u0434\">1975<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BF%D1%83%D0%B0_%E2%80%94_%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D0%93%D0%B2%D0%B8%D0%BD%D0%B5%D1%8F\" title=\"\u041f\u0430\u043f\u0443\u0430 \u2014 \u041d\u043e\u0432\u0430\u044f \u0413\u0432\u0438\u043d\u0435\u044f\">\u041f\u0430\u043f\u0443\u0430 \u2014 \u041d\u043e\u0432\u0430\u044f \u0413\u0432\u0438\u043d\u0435\u044f<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1976_%D0%B3%D0%BE%D0%B4\" title=\"1976 \u0433\u043e\u0434\">1976<\/a>&#160;\u2014 \u043c\u043d\u043e\u0433\u043e\u043a\u0440\u0430\u0442\u043d\u044b\u0439 \u0440\u0435\u043a\u043e\u0440\u0434\u0441\u043c\u0435\u043d \u0438 \u0447\u0435\u043c\u043f\u0438\u043e\u043d \u043c\u0438\u0440\u0430 \u043f\u043e \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u043e\u043c\u0443 \u043f\u043b\u0430\u0432\u0430\u043d\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%B0%D0%BF%D0%B5%D1%82%D1%8F%D0%BD,_%D0%A8%D0%B0%D0%B2%D0%B0%D1%80%D1%88_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0430\u0440\u0430\u043f\u0435\u0442\u044f\u043d, \u0428\u0430\u0432\u0430\u0440\u0448 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u0428\u0430\u0432\u0430\u0440\u0448 \u041a\u0430\u0440\u0430\u043f\u0435\u0442\u044f\u043d<\/a> \u0441\u043f\u0430\u0441 \u0441 10-\u043c\u0435\u0442\u0440\u043e\u0432\u043e\u0439 \u0433\u043b\u0443\u0431\u0438\u043d\u044b 20 \u0447\u0435\u043b\u043e\u0432\u0435\u043a, \u043a\u043e\u0433\u0434\u0430 \u043f\u0435\u0440\u0435\u043f\u043e\u043b\u043d\u0435\u043d\u043d\u044b\u0439 \u0442\u0440\u043e\u043b\u043b\u0435\u0439\u0431\u0443\u0441 \u0443\u043f\u0430\u043b \u0441 \u043c\u043e\u0441\u0442\u0430 \u0432 \u0415\u0440\u0435\u0432\u0430\u043d\u0441\u043a\u043e\u0435 \u0432\u043e\u0434\u043e\u0445\u0440\u0430\u043d\u0438\u043b\u0438\u0449\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1979_%D0%B3%D0%BE%D0%B4\" title=\"1979 \u0433\u043e\u0434\">1979<\/a>&#160;\u2014 \u0433\u0440\u0443\u043f\u043f\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/The_Grateful_Dead\" class=\"mw-redirect\" title=\"The Grateful Dead\">Grateful Dead<\/a>\u00bb \u0434\u0430\u043b\u0430 \u043a\u043e\u043d\u0446\u0435\u0440\u0442 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B3%D0%B8%D0%BF%D0%B5%D1%82\" title=\"\u0415\u0433\u0438\u043f\u0435\u0442\">\u0415\u0433\u0438\u043f\u0442\u0435<\/a> \u0443 \u043f\u043e\u0434\u043d\u043e\u0436\u044c\u044f \u043f\u0438\u0440\u0430\u043c\u0438\u0434.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1982_%D0%B3%D0%BE%D0%B4\" title=\"1982 \u0433\u043e\u0434\">1982<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B7%D0%BD%D1%8F_%D0%B2_%D0%A1%D0%B0%D0%B1%D1%80%D0%B5_%D0%B8_%D0%A8%D0%B0%D1%82%D0%B8%D0%BB%D0%B5\" title=\"\u0420\u0435\u0437\u043d\u044f \u0432 \u0421\u0430\u0431\u0440\u0435 \u0438 \u0428\u0430\u0442\u0438\u043b\u0435\">\u0440\u0435\u0437\u043d\u044f \u0432 \u043b\u0430\u0433\u0435\u0440\u044f\u0445 \u043f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u043a\u0438\u0445 \u0431\u0435\u0436\u0435\u043d\u0446\u0435\u0432 \u0421\u0430\u0431\u0440\u0430 \u0438 \u0428\u0430\u0442\u0438\u043b\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%B9%D1%80%D1%83%D1%82\" title=\"\u0411\u0435\u0439\u0440\u0443\u0442\">\u0411\u0435\u0439\u0440\u0443\u0442\u0435<\/a>, \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0437\u0430 2 \u0434\u043d\u044f \u043e\u0442 \u0440\u0443\u043a \u043b\u0438\u0432\u0430\u043d\u0441\u043a\u0438\u0445 \u0445\u0440\u0438\u0441\u0442\u0438\u0430\u043d-\u0444\u0430\u043b\u0430\u043d\u0433\u0438\u0441\u0442\u043e\u0432 \u043f\u043e\u0433\u0438\u0431\u043b\u0438, \u043f\u043e \u0440\u0430\u0437\u043d\u044b\u043c \u0441\u0432\u0435\u0434\u0435\u043d\u0438\u044f\u043c, \u043e\u0442 700 \u0434\u043e 3500 \u043b\u0438\u0432\u0430\u043d\u0446\u0435\u0432 \u0438 \u043f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u043a\u0438\u0445 \u0431\u0435\u0436\u0435\u043d\u0446\u0435\u0432. \u041c\u0438\u043d\u0438\u0441\u0442\u0440 \u043e\u0431\u043e\u0440\u043e\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8C\" title=\"\u0418\u0437\u0440\u0430\u0438\u043b\u044c\">\u0418\u0437\u0440\u0430\u0438\u043b\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D1%80%D0%BE%D0%BD,_%D0%90%D1%80%D0%B8%D1%8D%D0%BB%D1%8C\" title=\"\u0428\u0430\u0440\u043e\u043d, \u0410\u0440\u0438\u044d\u043b\u044c\">\u0410\u0440\u0438\u044d\u043b\u044c \u0428\u0430\u0440\u043e\u043d<\/a> \u0431\u044b\u043b \u043e\u0431\u0432\u0438\u043d\u0451\u043d \u0432 \u043f\u043e\u043f\u0443\u0441\u0442\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u0430\u043c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%B0%D0%BD\" title=\"\u041b\u0438\u0432\u0430\u043d\">\u041b\u0438\u0432\u0430\u043d\u0435<\/a> \u0438 \u0441\u043d\u044f\u0442 \u0441 \u043f\u043e\u0441\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1982_%D0%B3%D0%BE%D0%B4\" title=\"1982 \u0433\u043e\u0434\">1982<\/a>&#160;\u2014 \u041e\u0442\u043a\u0440\u044b\u0442 \u043c\u0435\u043c\u043e\u0440\u0438\u0430\u043b\u044c\u043d\u044b\u0439 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%BE%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA\" title=\"\u041d\u043e\u0432\u043e\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\">\u041d\u043e\u0432\u043e\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0435<\/a> (18-\u044f \u0430\u0440\u043c\u0438\u044f).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1983_%D0%B3%D0%BE%D0%B4\" title=\"1983 \u0433\u043e\u0434\">1983<\/a>&#160;\u2014 \u0430\u043a\u0442\u0451\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B0%D1%80%D1%86%D0%B5%D0%BD%D0%B5%D0%B3%D0%B3%D0%B5%D1%80,_%D0%90%D1%80%D0%BD%D0%BE%D0%BB%D1%8C%D0%B4\" title=\"\u0428\u0432\u0430\u0440\u0446\u0435\u043d\u0435\u0433\u0433\u0435\u0440, \u0410\u0440\u043d\u043e\u043b\u044c\u0434\">\u0410\u0440\u043d\u043e\u043b\u044c\u0434 \u0428\u0432\u0430\u0440\u0446\u0435\u043d\u0435\u0433\u0433\u0435\u0440<\/a> \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0435 \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u0442\u0432\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1985_%D0%B3%D0%BE%D0%B4\" title=\"1985 \u0433\u043e\u0434\">1985<\/a>&#160;\u2014 \u041e\u043a\u043e\u043d\u0447\u0430\u043d\u0438\u0435 \u0440\u0430\u0431\u043e\u0442\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D0%B0%D1%8F_%D0%B2%D1%8B%D1%81%D1%82%D0%B0%D0%B2%D0%BA%D0%B0_(1985)\" title=\"\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430 (1985)\">\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u043e\u0439 \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0438<\/a> \u042d\u043a\u0441\u043f\u043e-85 \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 \u0426\u0443\u043a\u0443\u0431\u0430, \u0418\u0431\u0430\u0440\u0430\u043a\u0438, \u042f\u043f\u043e\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1987_%D0%B3%D0%BE%D0%B4\" title=\"1987 \u0433\u043e\u0434\">1987<\/a>&#160;\u2014 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D1%80%D0%B5%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%80%D0%BE%D1%82%D0%BE%D0%BA%D0%BE%D0%BB\" title=\"\u041c\u043e\u043d\u0440\u0435\u0430\u043b\u044c\u0441\u043a\u0438\u0439 \u043f\u0440\u043e\u0442\u043e\u043a\u043e\u043b\">\u041c\u043e\u043d\u0440\u0435\u0430\u043b\u044c\u0441\u043a\u0438\u0439 \u043f\u0440\u043e\u0442\u043e\u043a\u043e\u043b<\/a> \u043e \u0437\u0430\u0449\u0438\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B7%D0%BE%D0%BD%D0%BE%D0%B2%D1%8B%D0%B9_%D1%81%D0%BB%D0%BE%D0%B9\" title=\"\u041e\u0437\u043e\u043d\u043e\u0432\u044b\u0439 \u0441\u043b\u043e\u0439