432\u0430\u043d \u0445\u0430\u043a\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%82%D0%BD%D0%B8%D0%BA,_%D0%9A%D0%B5%D0%B2%D0%B8%D0%BD\" title=\"\u041c\u0438\u0442\u043d\u0438\u043a, \u041a\u0435\u0432\u0438\u043d\">\u041a\u0435\u0432\u0438\u043d \u041c\u0438\u0442\u043d\u0438\u043a<\/a>, \u0432\u0437\u043b\u043e\u043c\u0430\u0432\u0448\u0438\u0439 \u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440\u043d\u0443\u044e \u0441\u0435\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D0%B5%D1%80%D1%81%D1%82%D0%B2%D0%BE_%D0%BE%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D1%8B_%D0%A1%D0%A8%D0%90\" title=\"\u041c\u0438\u043d\u0438\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u043e \u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0421\u0428\u0410\">\u041f\u0435\u043d\u0442\u0430\u0433\u043e\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1998_%D0%B3%D0%BE%D0%B4\" title=\"1998 \u0433\u043e\u0434\">1998<\/a>&#160;\u2014 \u0432\u044b\u0445\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D1%82%D1%80-%D0%94%D0%B0%D0%BC_%D0%B4%D0%B5_%D0%9F%D0%B0%D1%80%D0%B8_(%D0%BC%D1%8E%D0%B7%D0%B8%D0%BA%D0%BB)\" title=\"\u041d\u043e\u0442\u0440-\u0414\u0430\u043c \u0434\u0435 \u041f\u0430\u0440\u0438 (\u043c\u044e\u0437\u0438\u043a\u043b)\">\u043c\u044e\u0437\u0438\u043a\u043b\u0430 \u041d\u043e\u0442\u0440-\u0414\u0430\u043c \u0434\u0435 \u041f\u0430\u0440\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1999_%D0%B3%D0%BE%D0%B4\" title=\"1999 \u0433\u043e\u0434\">1999<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%80%D1%80%D0%BE%D1%80%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%BA%D1%82_%D0%B2_%D0%92%D0%BE%D0%BB%D0%B3%D0%BE%D0%B4%D0%BE%D0%BD%D1%81%D0%BA%D0%B5\" title=\"\u0422\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0430\u043a\u0442 \u0432 \u0412\u043e\u043b\u0433\u043e\u0434\u043e\u043d\u0441\u043a\u0435\">\u0412\u0437\u0440\u044b\u0432 \u0436\u0438\u043b\u043e\u0433\u043e \u0434\u043e\u043c\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D0%B3%D0%BE%D0%B4%D0%BE%D0%BD%D1%81%D0%BA\" title=\"\u0412\u043e\u043b\u0433\u043e\u0434\u043e\u043d\u0441\u043a\">\u0412\u043e\u043b\u0433\u043e\u0434\u043e\u043d\u0441\u043a\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%82%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C\" title=\"\u0420\u043e\u0441\u0442\u043e\u0432\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c\">\u0420\u043e\u0441\u0442\u043e\u0432\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c<\/a>). \u041f\u043e\u0433\u0438\u0431\u043b\u0438 19 \u0447\u0435\u043b\u043e\u0432\u0435\u043a, \u0431\u043e\u043b\u0435\u0435 200 \u0431\u044b\u043b\u0438 \u0440\u0430\u043d\u0435\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%B9%D1%82%D1%81,_%D0%91%D0%B8%D0%BB%D0%BB\" title=\"\u0413\u0435\u0439\u0442\u0441, \u0411\u0438\u043b\u043b\">\u0411\u0438\u043b\u043b \u0413\u0435\u0439\u0442\u0441<\/a> \u0438 \u0435\u0433\u043e \u0436\u0435\u043d\u0430 \u041c\u0435\u043b\u0438\u043d\u0434\u0430 \u043f\u043e\u0436\u0435\u0440\u0442\u0432\u043e\u0432\u0430\u043b\u0438 \u0431\u043e\u043b\u0435\u0435 $5&#160;\u043c\u043b\u0440\u0434 \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0435 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438, \u043f\u043e\u0441\u0432\u044f\u0449\u0451\u043d\u043d\u043e\u0439 \u0438\u0437\u0443\u0447\u0435\u043d\u0438\u044e \u0432\u043e\u043f\u0440\u043e\u0441\u043e\u0432 \u0443\u043b\u0443\u0447\u0448\u0435\u043d\u0438\u044f \u0437\u0434\u043e\u0440\u043e\u0432\u044c\u044f. \u0418\u0437 \u044d\u0442\u043e\u0439 \u0441\u0443\u043c\u043c\u044b $200&#160;\u043c\u043b\u043d \u043f\u043e\u0442\u0440\u0430\u0447\u0435\u043d\u044b \u043d\u0430 \u0437\u0430\u04